// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
contract MasKeyExchange {

    struct Agent {
        string name;
        bool isRegistered;
    }

    mapping(address => Agent) private agent;
    string private secretKey;
    address private mlfo;

    event AgentRegistered(address participant, string name);
    event AgentRemoved(address participant);
    event SecretKeySet(uint256 timestamp);

    constructor() {
        // Set the initial secret key to an empty string
        secretKey = ""; 
        mlfo = msg.sender;  
    }

    function RegisterAgents(address[] memory agentAddresses, string[] memory agentNames) public {
        require(msg.sender==mlfo, "Only the MLFO can register agents");
        require(agentAddresses.length == agentNames.length, "Mismatched input arrays");
        for (uint256 i = 0; i < agentAddresses.length; i++) {
            address agentAddress = agentAddresses[i];
            string memory agentName = agentNames[i];
            require(bytes(agentName).length > 0, string(abi.encodePacked(agentName, "name is not valid for agent")));
            require(agent[agentAddress].isRegistered == false, string(abi.encodePacked(agentName, " is already registered")));
            agent[agentAddress] = Agent({
                name: agentName,
                isRegistered: true
            });
            emit AgentRegistered(agentAddress, agentName);
        }
    }

    function RemoveAgents(address[] memory agentAddresses) public {
        require(msg.sender==mlfo, "Only the MLFO can remove agents");
        for (uint256 i = 0; i < agentAddresses.length; i++) {
            address agentAddress = agentAddresses[i];
            require(agent[agentAddress].isRegistered == true, string(abi.encodePacked(agent[agentAddress].name, " is not registered")));
            delete agent[agentAddress];
            emit AgentRemoved(agentAddress);
        }
    }

    function GetAgentInfo(address callAddress, address agentAddress) public view returns (string memory, bool) {
        require(callAddress == mlfo, "Only the MLFO can retrieve the agent info");
        Agent storage currentAgent = agent[agentAddress];
        return (
            currentAgent.name,
            currentAgent.isRegistered
        );
    }

    function SetSecretKey(string memory key) public {
        require(msg.sender == mlfo, "Only the MLFO can set the secret key");
        secretKey = key;
        emit SecretKeySet(block.timestamp);
    }

    function GetSecretKey(address callAddress) public view returns (string memory) {
        Agent storage currentAgent = agent[callAddress];
        require(currentAgent.isRegistered == true, "Agent is not registered. Can not look into. Please register.");
        return secretKey;
    }
}
